<?php   require_once './../../../libs/saewsclient/known/functions.php';   $parcial =  $_REQUEST["parcial"];   if($parcial==""){      $respuesta = json_decode(readParcialAll());      $array = [];      foreach($respuesta->results as $fila){         array_push($array,$fila);      }      echo json_encode($array);   }else{      $respuesta = json_decode(readParcial($parcial));      $array = [];      foreach($respuesta->results as $fila){         array_push($array,$fila);      }      echo json_encode($array);   }?>
